import React from 'react'
export default class ChildsChild extends React.Component{
    constructor(props)
    {
        super(props)
        this.state={
            MessageFrom :'Childs Child Message'
        }
    }

    render(){
        const styles = {
            Childs: {
                 backgroundColor:"Green"
            }
        };
        return <div style={styles.Childs}>
                    <p>First Child</p>
                     { this.state.MessageFrom}
               </div>
    };
}
